import AOS from "aos";
import { Trainers, Staff, members } from "./Data"

const Circles = (element) => {


    const [data, setData] = useState([])

    let members = 0
    let staff = 0
    let trainers = 0

    useEffect(() => {
        AOS.init(
        );

        if (element.type == "trainer") {
            setData(Trainers)
        } else if (element.type == "staff") {
            setData(Staff)
        } else {
            setData(members)
        }

    }, []);





    return (
        <div className="circles" data-aos="fade-up">
            {
                data.map((person) => (

                    <div className="circle" key={person.id}>
                        <img className={element.ppClass} src={person.photo} />
                        <div className={element.nameClass}>{person.firstName}</div>
                        {element.specialization &&
                            <div class={element.specialization}>{person.specialization}</div>
                        }
                    </div>

                )
                )
            }
        </div>
    )


}

export default Circles
